import './App.css';
import mePhoto from './meimg.jpg';


function App() {
  return (
    <div className="App">
      {/* head */}
      <div id="heads">

        <div>
          <h1>[-]</h1>
        </div>

        <div id="links">
          <span> <h3>Games</h3></span>
          <span> <h3>Music</h3></span>
          <span> <h3>Other Links</h3></span>
        </div>

      </div>

      {/* body */}
      <div id="body">
        <div>
          <img src={mePhoto} alt={'me photo'} />
        </div>
        <div>
          <p id="aboutme">This has a bio to it</p>

        </div>
      </div>

      {/* footer */}
      <div id="footer">
        <span> <h1>[-]</h1></span>
        <span>
          <p>Instagram</p>
          <p>LinkedIn</p>
          <p>Twitter</p>
        </span>
        <span> <p>Tic Tac Toe</p></span>
      </div>

    </div>
  );
}

// getting data from json file
let bio = document.getElementById('aboutme');

const fecthjson =  async () => {
  try {
    const data = await fetch('./info.json');
    const res = await data.json();
    bio.innerHTML = res;
  } catch (err) {
    console.log(err);
  }
}



export default App;
